import React from "react";
import Header from "./components/header"
import Body from "./components/body"
import Footer from "./components/footer"

export default class App {


  render() {
    return (
      <React.Component>
        <Header />
        <Body />
        <Footer onClick={this.createContact} />
      </React.Component>
    );
  }
}
